export default function Projet({name}){
    return <h1>{name}</h1>
}

export async function getStaticPaths() {
    
    return{
        
        paths: [
            {
                params: {
                    projet: 'elite-down'
                }
            },
            {
                params: {
                    projet: 'fallen-forest'
                }
            }
        ],
        fallback: false
    }
}

export async function getStaticProps({params}) {
    return {
        props:{
            name: "Elite Down"
        }
    }
}
